import React, { Component } from "react";
import Grid from "react-bootstrap/Grid";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Button from "react-bootstrap";
import Form from "react-bootstrap/Form";

import HunterMale from "../img/homepage/man.png";
import HunterFemale from "../img/homepage/woman.png";

import "../css/views/homepage.css";
class HomePage extends Component {
  constructor() {
    super();
    this.state = { title: "", type: "", location: "" };
  }

  render() {
    return (
      <div className="HomePage">
        <Grid id="hunterGrid">
          <Row>
            <Col lg={true}>
              <img
                id="hunterMale"
                src={HunterMale}
                alt="Male Hunter"
                width="300"
                height="300"
              />
            </Col>
            <Col lg={true}>
              <img
                id="hunterFemale"
                src={HunterFemale}
                alt="Female Hunter"
                width="300"
                height="300"
              />
            </Col>
          </Row>
          <Row>
            <Col lg={true}>
              <h1>Start Your Search for Your Next Job</h1>
            </Col>
          </Row>

          <Button id="register" variant="success">
            Register
          </Button>
        </Grid>

        <Grid id="quickSearchGrid">
          <Form>
            <Form.Group controlId="formBasicEmail">
              <Form.Label>Email address</Form.Label>
              <Form.Control type="email" placeholder="Enter email" />
              <Form.Text className="text-muted">
                We'll never share your email with anyone else.
              </Form.Text>
            </Form.Group>

            <Form.Group controlId="formBasicPassword">
              <Form.Label>Password</Form.Label>
              <Form.Control type="password" placeholder="Password" />
            </Form.Group>
            <Form.Group controlId="formBasicChecbox">
              <Form.Check type="checkbox" label="Check me out" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        </Grid>
      </div>
    );
  }
}

export default HomePage;
